    value: 'Amended to correct the MD-12 Inkind Transfer ratio on Sch H2 as Same as
      Previously Reported instead of New. The transfer reflected on Sch H3 on 10/9/12
      reflects the nonfederal expenses that were paid for and reported on Sch H4 for
      9/1/12 - 9/30/12. It was determined after this transfer was made that the Admin
      portion of the transfer was more than it should have been by $270.88 and the
      appropriate transfer was made back to the Nonfederal account by 10/26/12 - within
      the 60 day window. The General Survey expenditures listed on Schedule B, Line
      30(b) represent generic campaign activity and do not promote, attack, support
      or oppose any specifically identified Federal candidate and do not constitute
      an in-kind contribution, an independent expenditure or a coordinated party expenditure.
      The complete mailing address for the Winn Dixie expenditures listed on page
      280 of the report should be 1050 58 Street North, St. Petersburg, FL 33710 and
      that is not printing correctly on the report. No expenditure, other than a direct
      contribution or exempt activity so identified, was made on behalf of a specifically
      identified federal candidate. No expenditure not identified as such was for
      a public communication that referred to a clearly identified candidate for Federal
      office and that promoted, supported, attacked or opposed any such candidate
      for Federal office. All expenditures to individuals for rent that do not have
      a subsequent memo of itemization, represent rent income to those individuals
      and are not required to be itemized. All disbursements for salaries and benefits
      disclosed on Schedule H4 are for employees who did not spend more than 25% of
      their compensated time during the reporting period on Federal election activities
      or activities in connection with a Federal election. The Committee uses the
      Escrow option for receipt of corporate in-kind donations as provided for by
      the Commission in Advisory Opinion 1992-33. The method ensures that prohibited
      sources are not used to fund the federal share of allocable activity expenses.
      In-kind details and the escrow account activity are summarized as follows:   COMBINED
      ESCROW BALANCE OF $8,459.68 as of 9/30/12.  10/4/12 Transfer to MD-12 escrow
      acct of $35,000.  10/4/12 Walt Disney Parks & Resorts in-kind of $230,137.21
